// Buscar mesa por n칰mero
function buscarMesa() {
    let input = document.getElementById("buscador").value.trim().toLowerCase();
    let rows = document.querySelectorAll("#tabla-cuentas tbody tr");

    rows.forEach(row => {
        let mesa = row.cells[0].textContent.trim().toLowerCase();
        row.style.display = (mesa === input || input === "") ? "" : "none";
    });
}

