            // Convertir n칰mero a texto en JavaScript
function numeroATexto(numero) {
    const unidades = ["", "UNO", "DOS", "TRES", "CUATRO", "CINCO", "SEIS", "SIETE", "OCHO", "NUEVE"];
    const decenas = ["", "", "VEINTE", "TREINTA", "CUARENTA", "CINCUENTA", "SESENTA", "SETENTA", "OCHENTA", "NOVENTA"];
    const especiales = {
        10: "DIEZ", 11: "ONCE", 12: "DOCE", 13: "TRECE", 14: "CATORCE", 15: "QUINCE",
        16: "DIECIS칄IS", 17: "DIECISIETE", 18: "DIECIOCHO", 19: "DIECINUEVE"
    };

    let n = parseInt(numero);
    let parteDecimal = Math.round((numero - n) * 100);

    let texto = "";

    if (n === 0) {
        texto = "CERO";
    } else if (n <= 9) {
        texto = unidades[n];
    } else if (n >= 10 && n <= 19) {
        texto = especiales[n];
    } else if (n >= 20 && n <= 99) {
        let u = n % 10;
        let d = Math.floor(n / 10);
        texto = decenas[d] + (u > 0 ? ` Y ${unidades[u]}` : "");
    } else {
        texto = n.toString(); // Si es muy grande, mostrar n칰mero directamente
    }

    return `${texto} PESOS ${parteDecimal.toString().padStart(2, "0")}/100`;
}

