document.getElementById("generar-tira").addEventListener("click", () => {
    fetch("/todas-cuentas-respaldo")
        .then(res => res.json())
        .then(data => {
            const { jsPDF } = window.jspdf;
            const doc = new jsPDF({ orientation: 'portrait', unit: 'mm', format: [89, 350] });

            // Logo
            const logo = document.getElementById("logo-marche");
            const canvas = document.createElement("canvas");
            const ctx = canvas.getContext("2d");
            canvas.width = logo.naturalWidth;
            canvas.height = logo.naturalHeight;
            ctx.drawImage(logo, 0, 0);
            const logoBase64 = canvas.toDataURL("image/png");

            doc.addImage(logoBase64, 'PNG', 35, 2, 20, 20);
            let y = 26;
            doc.setFont("Helvetica", "normal");
            doc.setFontSize(9);
            doc.text("TIRA DE VENTA", 32, y); y += 4;
            doc.setFontSize(8);
            doc.text("CORTE DE CAJERO", 30, y); y += 4;
            doc.text("Palacio Mundo Imperial", 28, y); y += 4;
            doc.text("Marche", 37, y); y += 4;

            doc.line(10, y, 80, y); y += 4;

            const fechaHoy = new Date().toLocaleDateString("es-MX");
            doc.text(`Fecha: ${fechaHoy}`, 10, y); y += 4;

            const hora = new Date().toLocaleTimeString("es-MX", {
                hour: "2-digit", minute: "2-digit", hour12: true
            });
            doc.text(`Hora: ${hora}`, 10, y); y += 4;

            const horaActual = new Date().getHours();
            let turno = "-", tipo = "";
            if (horaActual >= 8 && horaActual <= 11) { turno = "1"; tipo = "Desayuno"; }
            else if (horaActual >= 12 && horaActual <= 17) { turno = "2"; tipo = "Comida"; }
            else if (horaActual >= 18 && horaActual <= 21) { turno = "3"; tipo = "Cena"; }

            doc.text(`Turno: ${turno}`, 10, y); y += 4;
            doc.line(10, y, 80, y); y += 4;
            doc.text("FORMAS DE PAGO", 25, y); y += 4;

            // Calculos
            const totalesPorForma = {};
            let totalAlimentos = 0, totalBebidas = 0;
            let descuentoAlimentos = 0, descuentoBebidas = 0;
            const propinasPorMesero = {};

            data.forEach(registro => {
                if (registro.Centroconsumo !== "Marche") return;

                const importes = (registro.Importe ?? "").split(",").map(e => parseFloat(e.trim()));
                const categorias = (registro.Categoria ?? "").split(",").map(e => e.trim().toLowerCase());
                const descuento = parseFloat(registro.Descuento || 0) / 100;

                for (let i = 0; i < Math.min(importes.length, categorias.length); i++) {
                    const cat = categorias[i];
                    const imp = importes[i];
                    if (!isNaN(imp)) {
                        const desc = imp * descuento;
                        const totalDesc = imp - desc;
                        if (cat.includes("alimento")) {
                            totalAlimentos += totalDesc;
                            descuentoAlimentos += desc;
                        } else if (cat.includes("bebida")) {
                            totalBebidas += totalDesc;
                            descuentoBebidas += desc;
                        }
                    }
                }

                const totalRegistro = importes.reduce((acc, val) => isNaN(val) ? acc : acc + val, 0);
                const forma = registro.Forma_Pago?.trim() || "OTROS";
                totalesPorForma[forma] = (totalesPorForma[forma] || 0) + totalRegistro;

                const propina = parseFloat(registro.Propina || 0);
                const mesero = registro.Mesero?.trim()
                if (!mesero) return;
                propinasPorMesero[mesero] = (propinasPorMesero[mesero] || 0) + propina;
            });

            const formasDePago = [
                'EFE', 'C-H', 'CXC', 'OID', 'PMQ',
                'TAR01', 'TAR02', 'TAR03', 'TAR06', 'TAR07',
                'BEBINC', 'CENINC', 'COMINC', 'DESINC',
                'GIPAL', 'GIPRIN', 'GIPIER'
            ];

            const tablaPagos = formasDePago.map(fp => {
                const monto = totalesPorForma[fp] || 0;
                return [fp, `$${monto.toFixed(2)}`];
            });

            doc.autoTable({
                startY: y,
                body: tablaPagos,
                theme: 'plain',
                styles: { fontSize: 7, halign: 'left', cellPadding: 1 },
                margin: { left: 10, right: 10 },
                tableLineColor: 200,
                tableLineWidth: 0.2
            });

            y = doc.lastAutoTable.finalY + 6;

            // Desglose A&B
            doc.setTextColor(0, 0, 0);
            doc.text(`DESGLOSE DE A&B`, 10, y); y += 5;
            doc.text(`ALIMENTOS:        $${totalAlimentos.toFixed(2)}`, 15, y); y += 5;
            doc.text(`BEBIDAS:          $${totalBebidas.toFixed(2)}`, 15, y); y += 5;
            doc.text(`TOTAL:            $${(totalAlimentos + totalBebidas).toFixed(2)}`, 15, y); y += 10;

            // Desglose descuentos
            doc.text(`DESGLOSE DESCUENTOS`, 10, y); y += 5;
            doc.text(`ALIMENTOS:        $${descuentoAlimentos.toFixed(2)}`, 15, y); y += 5;
            doc.text(`BEBIDAS:          $${descuentoBebidas.toFixed(2)}`, 15, y); y += 5;
            doc.text(`TOTAL:            $${(descuentoAlimentos + descuentoBebidas).toFixed(2)}`, 15, y); y += 10;

            // Tabla de propinas
            doc.setTextColor(0, 0, 0);
            doc.text(`PROPINAS`, 10, y); y += 5;

            const bodyPropinas = Object.entries(propinasPorMesero).map(([mesero, total]) => [
                mesero, `$${total.toFixed(2)}`
            ]);

            if (bodyPropinas.length > 0) {
                doc.autoTable({
                    startY: y,
                    head: [['Mesero', 'Total']],
                    body: bodyPropinas,
                    styles: { fontSize: 7, halign: 'center' },
                    margin: { left: 10, right: 10 }
                });
            } else {
                doc.text("No hay propinas registradas.", 15, y);
                y += 5;
            }

            doc.save(`tira_venta_marche.pdf`);
            fetch("/limpiar-respaldo", {
    method: "POST",
    headers: {
        "Content-Type": "application/json",
        "X-CSRF-TOKEN": document.querySelector('meta[name="csrf-token"]').content
    }
})
.then(res => res.json())
.then(res => {
    if (!res.success) {
        alert("Advertencia: El PDF fue generado, pero no se pudieron limpiar los datos.");
    } else {
        alert("Tira de venta generada y datos de respaldo limpiados.");
    }
})
.catch(() => {
    alert("Error al limpiar la tabla centrosdeconsumo_respaldo.");
});
        })
        .catch(() => alert("Error al generar la tira de venta."));
});








