document.getElementById("registrar-ayb").addEventListener("click", () => {
    const categoria = document.getElementById("categoria").value.trim();
    const cantidad = document.getElementById("cantidad").value.trim();
    const descripcion = document.getElementById("descripcion").value.trim();
    const importe = document.getElementById("importe").value.trim();
    const mesa = document.getElementById("mesa-ayb").value.trim();

    if (!categoria || !cantidad || !descripcion || !importe || !mesa) {
        return alert("Debes ingresar categoria, cantidad, descripcion, importe y mesa.");
    }

    fetch("actualizar-consumo-concat", {
        method: "POST",
        headers: {
            "Content-Type": "application/json",
            "Accept": "application/json",
            "X-Requested-With": "XMLHttpRequest",
            "X-CSRF-TOKEN": document.querySelector('meta[name="csrf-token"]').getAttribute("content")
        },
        body: JSON.stringify({
            categoria,
            cantidad,
            descripcion,
            importe,
            mesa
        })
    })
    .then(async res => {
        const data = await res.json().catch(() => null); // evita error por JSON vac칤o
        if (res.ok && data?.success) {
            alert("Consumo agregado correctamente.");
            cargarCuentasMarche();

            document.getElementById("categoria").value = "";
            document.getElementById("cantidad").value = "";
            document.getElementById("descripcion").value = "";
            document.getElementById("importe").value = "";
            document.getElementById("mesa-ayb").value = "";
        } else {
            alert(data?.error || "Consumo agregado correctamente.");
        }
    })
    .catch(() => alert("No se pudo conectar con el servidor. Verifica tu conexi칩n o la ruta."));
});

// Registrar propina
document.getElementById("registrar-propina").addEventListener("click", () => {
    const mesa = document.getElementById("mesa-ayb").value.trim();
    const propina = document.getElementById("propina").value.trim();
    const descuento = document.getElementById("descuento").value.trim();

    if (!mesa || !propina) {
        return alert("Debes ingresar el n칰mero de mesa, el monto de la propina y el descuento.");
    }

    fetch("/registrar-propina", {
        method: "POST",
        headers: {
            "Content-Type": "application/json",
            "X-CSRF-TOKEN": document.querySelector('meta[name="csrf-token"]').content
        },
        body: JSON.stringify({ mesa, propina, descuento })
    })
    .then(res => res.json())
    .then(res => {
        if (res.success) {
            alert("Propina y descuento registrados correctamente.");
            document.getElementById("mesa-ayb").value = ""; // limpiar campo
            document.getElementById("propina").value = ""; // limpiar campo
            document.getElementById("descuento").value = ""; // limpiar campo
        } else {
            alert("Error: " + (res.error || "No se pudo registrar la propina."));
        }
    })
    .catch(() => alert("Debes ingresar el n칰mero de mesa, el monto de la propina y el descuento."));
});








  